import React from "react";
import Slider from "react-slick"
import "slick-carousel/slick/slick.css"; 
import "slick-carousel/slick/slick-theme.css";
import banner1 from '../../../src/Assets/Images/blog 4.jpg'
import banner2 from '../../../src/Assets/Images/blog 5.jpg'
import banner3 from '../../../src/Assets/Images/blog 6.jpg'
import banner4 from '../../../src/Assets/Images/blog7.jpg'
import banner5 from '../../../src/Assets/Images/blog3.jpg'



const CatSlider =()=>{
      const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 3,
        slidesToScroll: 1,
        responsive: [
          {
            breakpoint: 768, // Adjust for smaller devices
            settings: {
              slidesToShow: 1,
              slidesToScroll: 1,
            },
          },
        ],
      };
    
    return(
        <div className="catSliderSection">
            <div className="container-fluid">
                <h2 className="hd">featured</h2>
                <Slider {...settings} className="cat_slider_Main">
               
                </Slider>
            </div>
        </div>)
}
export default CatSlider;
